import React from "react";
import web from "../src/images/img2.svg";
import Commom from "./Commom";

const Home = () => {
  return (
    <>
      <h1>स्वागतम !!</h1>
      <Commom
        name="Grow Your Business With"
        imgsrc={web}
        visit="/service"
        btname="Get Started"
      />
    </>
  );
};

export default Home;
